    { img: require("../../images/milkshakes/milkshake2.jpeg"), isChecked: false },
    { img: require("../../images/milkshakes/milkshake1.webp"), isChecked: false },
    { img: require("../../images/milkshakes/milkshake4.jpeg"), isChecked: false }
  ]);
  return(
    <main className="wrapper">
      <Products img={require("../../images/milkshakes/milkshake3.jpg")}/>
      <Products img={require("../../images/milkshakes/milkshake2.jpeg")}/>
      <Products img={require("../../images/milkshakes/milkshake1.webp")}/>
      <Products img={require("../../images/milkshakes/milkshake4.jpeg")}/>
    </main>
  )
}

export default Main;
